import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import { createStore, combineReducers } from 'redux';
import configureStore from './store/store.js';
import { addExpense, removeExpense } from './actions/expenses.js';

const store = configureStore();

store.dispatch(addExpense({ id: 1, type: 'Cemil', description: 'Cemils expense ', amount: 2000, createdAt: 0 }));
store.dispatch(addExpense({ id: 2, type: 'Arda', description: 'Ardas expense ', amount: 2000, createdAt: 0 }));
store.dispatch(removeExpense(1));
console.log("Store is ", store.getState());
ReactDOM.render(<App />, document.getElementById('root'));
// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
